const items = $input.all();  // Obtiene los datos del input

return items.flatMap(item => {
    let data;
    try {
        data = JSON.parse(item.json.concatenated_data);
    } catch (error) {
        console.error("Error al parsear JSON.", error);
        return [];
    }

    // Construye un solo texto con todos los autos separados por doble nueva línea (\n\n)
    const processedData = data.map(entry => {
        return Object.entries(entry)
            .map(([key, value]) => `${key.replace(/_/g, " ")}: ${value}`)
            .join("\n");  // Cada atributo en una nueva línea
    }).join("\n\n");  // Cada auto separado por una doble nueva línea

    return [{ processed_data: processedData }];
});

const items = $input.all();

return items.map(item => {
  let texto = item.json.text;

  // Eliminar caracteres Unicode inválidos o especiales que rompen Supabase
  texto = texto.replace(/\\u0000/g, '')    // elimina secuencias inválidas como \u0000
               .replace(/[^\x20-\x7E\náéíóúÁÉÍÓÚñÑüÜ]/g, '') // elimina caracteres no imprimibles (conserva letras españolas)
               .replace(/\\n/g, '\n');    // convierte \n a saltos reales

  return { json: { texto_limpio: texto } };
});

return $input.all().map(item => {
    let currentVersion = item.json.metadata.version;

    // Extraer el número de la versión y sumarle 1
    let versionNumber = parseInt(currentVersion.replace('v', ''), 10);
    let newVersion = `v${versionNumber + 1}`;

    // Retornar solo la nueva versión
    return { json: { version: newVersion } };
});

